  order: number;
  id: string;
  name: string;
  date: string;
  title: string;
  content: string;
}

interface PostTrProps {
  user_data: [];
}

const PostTr = (user_data: any) => {
  return (
    <tbody>
      <PostTd item={user_data[0]} />
